const solvePuzzle = (input) => {
  const units = input.split('');

  const uniqueUnits = getUniqueUnits(units);
  
  let lowest;
  
  let i = uniqueUnits.length - 2;
  while (i--) {
    const size = calculatePolymerSize(units.filter(u => u.toLowerCase() !== uniqueUnits[i]));
    if (!lowest || size < lowest) lowest = size;
  }

  return lowest;
}

const getUniqueUnits = (units) => {
  const uniqueUnits = [];
  
  let i = units.length - 1;
  while (i--) {
    const unitToLower = units[i].toLowerCase();
    if (uniqueUnits.indexOf(unitToLower) === -1) {
      uniqueUnits.push(unitToLower);
    }
  }

  return uniqueUnits;
}

const calculatePolymerSize = (units) => {
  let i = units.length - 2;
  while (i--) {
    if (!units[i + 1]) continue;

    if (Math.abs(units[i].charCodeAt(0) - units[i + 1].charCodeAt(0)) === 32) {
      units.splice(i, 2);
    }
  }
  return units.length;
}

const CORRECT_ANSWER = 4996;
const INPUT = '';

const startDate = new Date();
const result = solvePuzzle(INPUT);
console.log('--- Puzzle result ---\n');
console.log(result);
console.log(result === CORRECT_ANSWER ? 'Test success' : 'Test fail');
console.log('Run time:', (new Date() - startDate)/1000, 'seconds');
console.log('\n---------------------');
